script: |
  super -f text -I q3233.spq | sort > q3233.out

inputs:
  - name: q3233.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( + col0 ) * + + col2 + col1 NOT BETWEEN - col0 * 21 + - 30 AND 86 * - col2;
  - name: tab2

outputs:
  - name: q3233.out
    data: |
      46	51	23
      64	77	40
      75	67	58
